import React from 'react'

function Commentbox(props) {

    return (
        <>
            <div className="comment-box-container">
                <span>Name : {props.data.name}</span>
                <span>email : {props.data.email}</span>
                <span>Comment : {props.data.commentContent}</span>
                <span>Date : {props.data.date}</span>
                <span>Igone : {props.data.ignore}</span>
                <span>ParentNode : {props.data.parentNodeId}</span>
            </div>
        </>
    )
}
export default Commentbox;
